import React from 'react';

const AidbSection: React.FC = () => {
  return (
    <section id="aidb" className="py-16 bg-neutral-50 dark:bg-neutral-900 border-b border-neutral-200 dark:border-neutral-800">
      <div className="container-max px-4 sm:px-6 lg:px-8">
        <h2 className="text-4xl sm:text-5xl font-extrabold text-neutral-900 dark:text-white leading-tight mb-4">
          project (a)idb
        </h2>
        <p className="text-lg text-neutral-500 dark:text-neutral-400 max-w-2xl">
          This is a placeholder for the project (a)idb section. Add your content here!
        </p>
      </div>
    </section>
  );
};

export default AidbSection;
